Authzen contexts are data types which hold all of the necessary http clients/connections to the underlying authorization engines, data data sources and transaction caches. In rust, they are any type which implements AuthorizationContext . AuthorizationContext can be derived on structs like so: #[derive(Clone, Copy, authzen::Context, authzen::data_sources::diesel::Db)]
pub struct Context<D> { #[subject] pub session: uuid::Uuid, #[db] #[data_source] pub db: D, #[authz_engine] pub opa_client: authzen::authz_engines::opa::OPAClient, #[transaction_cache] pub mongodb_client: authzen::transaction_caches::mongodb::MongodbTxCollection,
} or if you want to do so in a generic way you could define context like this #[derive(Clone, Copy, Context, Derivative, Db)]
#[derivative(Debug)]
pub struct Context<D, S, C, M> { #[subject] pub session: S, #[db] #[derivative(Debug = "ignore")] #[data_source] pub db: D, #[authz_engine] #[derivative(Debug = "ignore")] pub opa_client: C, #[transaction_cache] #[derivative(Debug = "ignore")] pub mongodb_client: M,
}
pub type Ctx<'a, D> = Context<D, &'a AccountSession, &'a OPAClient, &'a MongodbTxCollection>;
pub type CtxOptSession<'a, D> = Context<D, Option<&'a AccountSession>, &'a OPAClient, &'a MongodbTxCollection>;

